import React from "react";
import beranda from "./beranda.png";
import login from "./login.png";
import kategori from "./kategori.png";
import "./style/Kepala.css";

export const Navbar = () => {
  return (
    <div className="navigasi">
      <nav>
        <a className="navchild">
          <img src={beranda} />
          Beranda
        </a>

        <a className="navchild">
          <img src={kategori} />
          Login
        </a>

        <a className="navchild">
          <img src={login} />
          Login
        </a>
      </nav>
    </div>
  );
};
